  true,\n\t\"url\": null,\n\t\"notes\": \"The Wadeable Streams Assessment (WSA) is
  a first-ever statistically-valid survey of the biological condition of small streams
  throughout the U.S. The U.S. Environmental Protection Agency (EPA) worked with the
  states to conduct the assessment in 2004-2005.  Data for each parameter sampled
  in the Wadeable Streams Assessment (WSA) are available for downloading in a series
  of files as comma separated values (*.csv). Each *.csv data file has a companion
  text file (*.txt) that lists a dataset label and individual descriptions for each
  variable. Users should view the *.txt files first to help guide their understanding
  and use of the data.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
